import "./write.css"

export default function Write() {
  return (
    <div className="write">
      <form className="writeform">
        <div className="wfGrup">
          <input type="file" id="fileInput" />
          <input type="text" placeholder="Judul" />
        </div>
      </form>
    </div>
  )
}
